$(document).ready(function(){
    var inf;
    $('#list_vehiculos').DataTable({
        dom: 'Blfrtip',
        buttons: [{
                extend: 'excelHtml5',
                messageTop: 'Areas',
                text: "Excel",
                title: "Listado de Vehiculos Entregados",
            },
            {
                /*'csvHtml5',*/
                extend: 'csvHtml5',
                text: "CSV",
                title: "Listado de Vehiculos Entregados",
                messageTop: 'Listado de Vehiculos Entregados',
            },
            {
                extend: 'pdfHtml5',
                title: 'Listado de Vehiculos Entregados'
            }
        ],
        responsive: true,
        destroy: true,
        language: {
            "sProcessing":     "Procesando...",
                        "sLengthMenu":     "Mostrar _MENU_ registros",
                        "sZeroRecords":    "No se encontraron resultados",
                        "sEmptyTable":     "Ningún dato disponible en esta tabla =(",
                        "sInfo":           "Mostrando registros del _START_ al _END_ de un total de _TOTAL_ registros",
                        "sInfoEmpty":      "Mostrando registros del 0 al 0 de un total de 0 registros",
                        "sInfoFiltered":   "(filtrado de un total de _MAX_ registros)",
                        "sInfoPostFix":    "",
                        "sSearch":         "Buscar:",
                        "sUrl":            "",
                        "sInfoThousands":  ",",
                        "sLoadingRecords": "Cargando...",
                        "oPaginate": {
                            "sFirst":    "Primero",
                            "sLast":     "Último",
                            "sNext":     "Siguiente",
                            "sPrevious": "Anterior"
                        },
                        "oAria": {
                            "sSortAscending":  ": Activar para ordenar la columna de manera ascendente",
                            "sSortDescending": ": Activar para ordenar la columna de manera descendente"
                        },
                        "buttons": {
                            "copy": "Copiar",
                            "colvis": "Visibilidad"
                        }
        },
        select: true,
        pageLength: 100

    });

    $("#articulo").on('keyup', function() {
        let data = $(this).val();

        if (data == 'pintura') {
            $("#sfpago").val(3);
            $("#sfactura").val(1);
            $("#cpago").val(5);
            $("#proveedor").val('Global Centro');
        }
    })

    $("#articulo").on('keyup', function(){
        let data = $(this).val();
        if (data == 'Prestamo' || data == 'Préstamo') {
            $("#sfpago").val(2);
            $("#sfactura").val(2);
            $("#cpago").val(3);
            $("#proveedor").val('Empleados DTR');
            $("#expediente").val('N/A');
        }
    })

    if ($("#tgasto").val() != 6 || $("#tgasto").val() != 9) {
        $("#expediente").val('N/A');
        $("#info").text('No aplica');
        $("#inf").css('border-radius', '5px');
        $("#inf").css('background-color', '#53ee7e'); 
    }

    $("#expediente").on('keyup', function(){
        var dataa = $(this).val();
        
        if (dataa == 'N/A') {
            $("#info").text('No aplica');
            $("#inf").css('border-radius', '5px');
            $("#inf").css('background-color', '#53ee7e'); 
        } else {
            $.ajax({
                url: 'existe_vehiculo_gastos_recibo',
                type: 'GET',
                data: {
                    id: dataa
                },
                success: function(result){
                    //console.log(result)
                    if (result['resultado'] == 0) {
                        $("#exp").text('Vehiculo No Encontrado');
                        $("#expp").css('border-radius', '5px');
                        $("#expp").css('background-color', '#F08080');  
                    } else {
                        $("#inf").fadeIn();
                        $("#inf").css('border-radius', '5px');
                        $("#inf").css('background-color', '#53ee7e'); 
                        $("#info").text('Vehiculo: '+ result[0]['marcas']['marca'] + ' ' + result[0]['submarcas']['submarca'] + ' ' + result[0]['color'] + ' ' + result[0]['modelo'] + ' ' + result[0]['clientes']['nombre']);
                        $("#iexpediente2").val($("#iexpediente").val()); 
                    }
                }
            })
        }
    })

    $("#btn_registrar").on('click', function(){
        if ($("#fecha").val() == "") {
            
            Swal.fire({
                icon: 'error',
                title: 'Oops...',
                text: 'Ingresa la fecha',
            })

            return false
        }

        if ($("#articulo").val() == "") {
            
            Swal.fire({
                icon: 'error',
                title: 'Oops...',
                text: 'Ingresa el Concepto',
            })

            return false
        }


        if ($("#cantidad").val() == "") {
            
            Swal.fire({
                icon: 'error',
                title: 'Oops...',
                text: 'Ingresa la cantidad',
            })

            return false
        }

        if ($("#sfpago").val() == 0) {
            
            Swal.fire({
                icon: 'error',
                title: 'Oops...',
                text: 'Ingresa la Forma de pago',
            })

            return false
        }
        
        if ($("#sfactura").val() == 0) {
            Swal.fire({
                icon: 'error',
                title: 'Oops...',
                text: 'Ingresa el si aplica factura',
            })
              
            return false
        }

        if ($("#tgasto").val() == 0) {
            Swal.fire({
                icon: 'error',
                title: 'Oops...',
                text: 'Ingresa el tipo de gasto',
            })
              
            return false
        }

        if ($("#proveedor").val() == "") {
            Swal.fire({
                icon: 'error',
                title: 'Oops...',
                text: 'Ingresa el proveedor',
            })
              
            return false
        }

        if ($("#expediente").val() == "") {
            Swal.fire({
                icon: 'error',
                title: 'Oops...',
                text: 'Ingresa el expediente',
            })
              
            return false
        }

        var img = "data:image/jpeg;base64,";

        const doc = new jsPDF();
        doc.addImage(img, 'jpg', 0, 0, 210, 300);
        doc.setFontSize(12);
        let f1 = new Date();
        let f2 = f1.getDate() + "-" + (f1.getMonth() +1) + "-" + f1.getFullYear()
        doc.text(155, 58, f2)
        doc.text(155, 176.8, f2)
        if ($("#folio").val() != null ) {
            let folio = Number($("#folio").val()) + 1;
            $("#folio").val(folio);
            doc.text(155, 63.8, '' + folio);
            doc.text(155, 183, '' + folio);
            $("#folio").val(folio);
        } else {
            $("#folio").val(1);
            doc.text(155, 63.8, '1');
            doc.text(155, 183, '1');
        }
        doc.text(155, 69, $("#expediente").val());
        doc.text(155, 188, $("#expediente").val());
        doc.text(52, 76, $("#proveedor").val());
        doc.text(52, 194, $("#proveedor").val());
        doc.text(60, 82, '$' + $("#cantidad").val());
        doc.text(60, 200, '$' + $("#cantidad").val());
        doc.text(65, 88, $("#articulo").val());
        doc.text(65, 205, $("#articulo").val());
        doc.text(65, 100, $("#sfpago option:selected").text());
        doc.text(65, 221, $("#sfpago option:selected").text());
        doc.save('' + $("#folio").val() +'_recibo_pago_proveedor');

    })

})